VALIDATION_SCHEMA:
{
  "definitions": {},
  "$schema": "http://json-schema.org/draft-07/schema#",
  "$id": "http://example.com/root.json",
  "type": "object",
  "title": "The Root Schema",
  "required": [
    "origin_city_id",
    "dest_city_id",
    "travel_date"
  ],
  "properties": {
    "origin_city_id": {
      "$id": "#/properties/origin_city_id",
      "type": "integer",
      "title": "The Origin_city_id Schema",
      "default": 0,
      "examples": [
        3
      ]
    },
    "dest_city_id": {
      "$id": "#/properties/dest_city_id",
      "type": "integer",
      "title": "The Dest_city_id Schema",
      "default": "",
      "examples": [
        "6"
      ]
    },
    "travel_date": {
      "$id": "#/properties/travel_date",
      "type": "string",
      "title": "The Travel_date Schema",
      "default": "",
      "examples": [
        "2019-04-23"
      ],
      "pattern": "^(.*)$",
      "format": "date"
    }
  }
}
